import React, { Component } from 'react';
import './Buttons.scss';

class Buttons extends Component {
  render() {
    return (
      <div className="pageBtn">
        <button>1</button>
        <button>2</button>
        <button>3</button>
        <button>4</button>
        <button>5</button>
      </div>
    );
  }
}

export default Buttons;
